import './App.css';
import Header from './components/Header';
import CurrentLocation from './components/CurrentLocation';
import Weatherforcast from './components/Weatherforcast';

//first we deal with the currnt location situation

function App() {
  const appid = "6a4306a0f2c73c28dc5c3bbf739e87d0";


  fetch(`api.openweathermap.org/data/2.5/forecast?lat=44.34&lon=10.99&appid=${appid}`
  )
  .then(response => response.json())
  .then(data => console.log(data))

  return (
    <div className="App">
      <Header/>
      <h1>Get weather update here</h1>
      <CurrentLocation/>
      <Weatherforcast/>
    </div>
  );
}

export default App;
